import React from "react";
import { useState, useRef } from "react";

function LoginPage({ getUser }) {
  let inEmail = useRef();
  let inPass = useRef();

  function verify() {
    console.log(inEmail.value);
  }
  return (
    <div className="login">
      <input ref={inEmail} type="text" placeholder="username" />
      <input ref={inPass} type="text" placeholder="pasword" />
      <button onClick={verify}>LOGIN</button>
    </div>
  );
}

export default LoginPage;
